import {toast} from "react-toastify";

class AuthNotify {
    static NotAuthorized() {
        return toast.error('You are not authorized',
            {
                position: "top-center",
                autoClose: 2000,
                hideProgressBar: false,
                closeOnClick: true,
                pauseOnHover: true,
                draggable: true,
                theme: "colored",
            });
    }

    static async LoginSuccess() {
       return await toast.success('Successful authorization', {
            position: "top-center",
            autoClose: 2000,
            hideProgressBar: false,
            closeOnClick: true,
            pauseOnHover: true,
            draggable: true,
            theme: "light",
        });
    }
}

export default AuthNotify;
